INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190804, 0, 1, "カリン", 1, 1, 60000, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 2, "", 1, 2, 60000, 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 3, "", 1, 2, 60000, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 4, "", 2, 2, 60000, 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 5, "", 1, 2, 60000, 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 6, "", 1, 2, 60000, 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 7, "", 2, 2, 60000, 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 8, "", 1, 2, 60000, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 9, "", 1, 2, 60000, 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 10, "", 1, 2, 60000, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 11, "", 1, 2, 60000, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 12, "", 2, 2, 60000, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 13, "", 1, 2, 60000, 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 14, "", 1, 2, 60000, 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 15, "", 1, 2, 60000, 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 16, "", 1, 2, 60000, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 17, "", 2, 2, 60000, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190804, 0, 18, "カリン", 0, 3, 60000, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190804, 0, 19, "カリン", 0, 3, 60000, 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 101201, 0, 20, "ハツネ", 0, 0, 80001, 1, "キミと出会ってもう\n1年もたつんだね！\nう～ん、いつも\n寝てばっかりだから、", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 101201, 0, 21, "ハツネ", 0, 0, 80001, 1, "少しでも\n寝る時間を減らして\nキミと一緒にいる\n時間増やしたいなぁ♪", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 103801, 0, 22, "シオリ", 0, 1, 80001, 1, "あなたと知り合ってから\nもう1年…\n時がたつのは\n早いですね", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 103801, 0, 23, "シオリ", 0, 1, 80001, 1, "来年も、\n一緒にいられたら…\nうれしいな", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 103601, 0, 24, "キョウカ", 0, 0, 80001, 2, "あなたと一緒にいるようになって、\nもう1年ですか…", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 103601, 0, 25, "キョウカ", 0, 0, 80001, 2, "最初の頃よりも、頼もしく\nなりましたね。私はどうですか？\n成長していますか？", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 102001, 0, 26, "ミミ", 0, 1, 80001, 2, "おにいちゃんとあってから、\n1年たったよ～！", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 102001, 0, 27, "ミミ", 0, 1, 80001, 2, "ミミね、おにいちゃんと\nいっぱい遊べてたのしかったな～♪\nこれからもずっと\nいっしょにいてね～！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 100401, 0, 28, "ミソギ", 0, 2, 80001, 2, "にいちゃんがミソギのイタズラに\n引っかかり続けてもう1年かぁ", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 100401, 0, 29, "ミソギ", 0, 2, 80001, 2, "…これからもいっぱいミソギと\n遊んでね、にいちゃん！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 101001, 0, 30, "マホ", 0, 0, 80001, 3, "もう王子はんと会うてから\n1年ぐらいたつそうどすえ\n早いもんやなあ", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 101001, 0, 31, "マホ", 0, 0, 80001, 3, "このままやと、\nうちもあっという間に\n干からびてしまいそうどすえ\nなーんてな。うふふ", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 104401, 0, 32, "イリヤ", 0, 1, 80001, 3, "お主と会って早1年じゃな\nこれからも存分に尽くすがよい", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 104401, 0, 33, "イリヤ", 0, 1, 80001, 3, "わらわもたまには、お主の献身に\n報いてやらぬでもない♪", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 101701, 0, 34, "カオリ", 0, 2, 80001, 3, "もう、キミと出会って結構な時間が\nたつさ～。でも、私たちの旅は\nまだまだ始まったばかりさ～！", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 101701, 0, 35, "カオリ", 0, 2, 80001, 3, "これからも、どうぞよろしく\nお願いするさ～！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 102801, 0, 36, "サレン", 0, 0, 80001, 4, "あんたと出会ってからもうそんなに\nたつのね～", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 102801, 0, 37, "サレン", 0, 0, 80001, 4, "あっという間だったって感じるほど\n楽しかったわ！\nこれからも一緒に頑張りましょ！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 102501, 0, 38, "スズメ", 0, 1, 80001, 4, "出会ってから1年間、ずっと\nご迷惑をかけっぱなしで、\nすみません…", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 102501, 0, 39, "スズメ", 0, 1, 80001, 4, "これからはもっと頑張りますから\n見ていてくださいね\nできれば…\n今までよりも、私の近くで♪", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 104601, 0, 40, "タマキ", 0, 0, 80001, 5, "振り返れば、今までいろんなことが\nあったにゃあ…", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 104601, 0, 41, "タマキ", 0, 0, 80001, 5, "これからも、二人でたくさんの\n思い出をがっぽり作っていく\nにゃー！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 104801, 0, 42, "ミフユ", 0, 1, 80001, 5, "キミとの師弟関係も、\nもう1年なのね…\nでもキミに教えることは、", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 104801, 0, 43, "ミフユ", 0, 1, 80001, 5, "まだまだいっぱいあるわ\nこれからも、\nしっかりついて来てね！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 103201, 0, 44, "アキノ", 0, 0, 80001, 6, "あなたさまと出会ってもう1年…", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 103201, 0, 45, "アキノ", 0, 0, 80001, 6, "光陰矢のごとし、とはまさに\nこのことですわ。…思い出は決して\nお金では買えませんわね", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 103401, 0, 46, "ユカリ", 0, 1, 80001, 6, "ダメな私を1年間も見捨てないで\nくれて、本当にありがとう", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 103401, 0, 47, "ユカリ", 0, 1, 80001, 6, "情けないところいっぱいみせるかも\nしれないけど、これからも一緒に\nいてくれると、うれしいな", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 107101, 0, 48, "クリスティーナ", 0, 0, 80001, 7, "オマエと出会ってもう1年か\nまさかこのワタシの結婚相手に\nなろうとはな…", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 107101, 0, 49, "クリスティーナ", 0, 0, 80001, 7, "ともかくこれからも\n愉しませてくれよ☆", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 104701, 0, 50, "ジュン", 0, 1, 80001, 7, "君と出会ってからもう1年か。\n以前と比べて私の表情もいくらか\n柔らかくなった気がするんだが、\nどうだろう？", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 104701, 0, 51, "ジュン", 0, 1, 80001, 7, "見えないから分からないって？\nそれもそうだな…", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 103701, 0, 52, "トモ", 0, 0, 80001, 8, "もう1年たったみたいだね\nあなたをからかってばかりだった\nけど、楽しかった♪", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 103701, 0, 53, "トモ", 0, 0, 80001, 8, "これからもよろしくね！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 100501, 0, 54, "マツリ", 0, 1, 80001, 8, "出会って、もう1年たっちゃった\nんスね。なんだか意外ッス", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 100501, 0, 55, "マツリ", 0, 1, 80001, 8, "毎日楽しくて、あっという間に過ぎ\nちゃったみたいなんスよね\nこれからも一緒に悪と戦うッス！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 100701, 0, 56, "ミヤコ", 0, 0, 80001, 9, "オマエと会って1年なの！\n全然成仏もできなかったし、", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 100701, 0, 57, "ミヤコ", 0, 0, 80001, 9, "生き返りもしなかったけど、\nすごく楽しかったの～♪\nオマエとプリンがあれば、\nミヤコはハッピーなの～♪", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 103101, 0, 58, "シノブ", 0, 1, 80001, 9, "あなたと出会って1年なんですね\nでも、私の占いでは、私とあなたは", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 103101, 0, 59, "シノブ", 0, 1, 80001, 9, "来年も再来年も一緒にいるようです\nふふ、よろしくお願いしますね", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 100901, 0, 60, "アンナ", 0, 0, 80001, 10, "貴様が閃光のシグルドとして覚醒し\nもう1年か…。これからも我らの\n長き戦いに終わりはないが、", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 100901, 0, 61, "アンナ", 0, 0, 80001, 10, "それでも貴様となら…\n添い遂げる覚悟はできているぞ！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 101301, 0, 62, "ナナカ", 0, 1, 80001, 10, "君と出会ってもう1年だって！\n早いねー！", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 101301, 0, 63, "ナナカ", 0, 1, 80001, 10, "これからも最強のバディタッグで\n大活躍だー！\n頼りにしてるよ、相棒！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105101, 0, 64, "ミツキ", 0, 0, 80001, 11, "1年たつのって、あっという間ね\nまだまだ君の知らない部分が\nたくさんあるし…", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105101, 0, 65, "ミツキ", 0, 0, 80001, 11, "これからも、いろんなところを\n調べさせてね？", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105601, 0, 66, "ルカ", 0, 1, 80001, 11, "お前さんと出会ってもう1年か\n助太刀するつもりが", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105601, 0, 67, "ルカ", 0, 1, 80001, 11, "逆に助けられたりもしたね\nこれからもよろしく頼むよ！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 102701, 0, 68, "エリコ", 0, 2, 80001, 11, "早いものですわね、あなた様と\nお会いして、もう1年…", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 102701, 0, 69, "エリコ", 0, 2, 80001, 11, "あなた様といると、時があっと\nいう間に過ぎてしまいます\n時間を止める研究をしなくては\nいけませんね…", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 102301, 0, 70, "アヤネ", 0, 0, 80001, 12, "お兄ちゃんと会ってから、もう、\n1年なんだね。私、少しは\nお姉ちゃんっぽくなったかな？", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 102301, 0, 71, "アヤネ", 0, 0, 80001, 12, "あ、ぷうきちもお兄ちゃんっぽく\nなったよね？", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 104201, 0, 72, "チカ", 0, 1, 80001, 12, "あなたと出会って、\nもう1年がたったんですね…\nこれからもそばにいて、", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 104201, 0, 73, "チカ", 0, 1, 80001, 12, "私のことを見守ってください\nできることなら、ずっと…", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 102101, 0, 74, "クルミ", 0, 2, 80001, 12, "お兄ちゃんと出会って1年かぁ\n私、相変わらずダメダメで…", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 102101, 0, 75, "クルミ", 0, 2, 80001, 12, "で、でもこれからもずっと…\n一緒にいたいなぁ…", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 104901, 0, 76, "シズル", 0, 0, 80001, 13, "再会してちょうど1年だね\nお祝いにごちそう作ってきたよ～♪\n特製ケーキと、お寿司と、", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 104901, 0, 77, "シズル", 0, 0, 80001, 13, "ハンバーグと、カレーと、\nシチューと、あ、隠しきれない隠し\n味は、お姉ちゃんの愛情だよ！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 101101, 0, 78, "リノ", 0, 1, 80001, 13, "お兄ちゃんと再会して、もう1年\nなんですね。\n会えなかった時を思うと、", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 101101, 0, 79, "リノ", 0, 1, 80001, 13, "信じられないくらい幸せな1年\nでした！もう絶対、私から離れ\nないでくださいね♪", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 100201, 0, 80, "ユイ", 0, 0, 80001, 14, "騎士クンと出会ってから今まで、\nいろんなことがあったよね\n楽しいこと、ドキドキしたこと…", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 100201, 0, 81, "ユイ", 0, 0, 80001, 14, "そんな日々をこれからも、\nず、ずっと一緒に…\n過ごしていきたいな…！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 100101, 0, 82, "ヒヨリ", 0, 1, 80001, 14, "騎士くんと出会って、まだ1年しか\nたってないんだ！？", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 100101, 0, 83, "ヒヨリ", 0, 1, 80001, 14, "なんかもうずっと一緒にいる気が\nするなぁ…えへへ。これからの\n1年もまたよろしくねっ！\n騎士くん！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 100301, 0, 84, "レイ", 0, 2, 80001, 14, "初めてキミに出会って1年…\n随分見違えたね私もキミも、\n更に強くなっていく…", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 100301, 0, 85, "レイ", 0, 2, 80001, 14, "キミに背中を預けられる日が、\n早くきますように", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 86, "ペコリーヌ", 0, 0, 80001, 15, "1年もわたしのことを、忘れない\nでいてくれて、ありがとうござい\nます！", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 87, "ペコリーヌ", 0, 0, 80001, 15, "これからもずっと、覚えていて\nくださいね！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 88, "コッコロ", 0, 1, 80001, 15, "こうして1年も、主さまのおそばに\n置いていただけて、とても光栄\nです。どうかこれからも、", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 89, "コッコロ", 0, 1, 80001, 15, "末永く主さまをお世話させて\nください。わたくしは、ずっと\n主さまのガイド役でいたいのです", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 90, "キャル", 0, 2, 80001, 15, "1年か、まっさかこんなに長い\n付き合いになるなんてね～\nでも…わりと楽しい1年だったかも", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 91, "キャル", 0, 2, 80001, 15, "だから、もうしばらくあんたに\n付き合ってやるわよ喜びなさい！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 112101, 0, 92, "スズメ", 1, 1, 60001, 0, "新しい年のはじめに、\nおみくじはいかがでしょうか？\nよい運勢であるほど、\n沢山プレゼントが貰えますよ♪", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 93, "", 1, 2, 60001, 0, "今日の運勢は姫吉！　あらゆる運気が最大を示しています！　　　今なら「伝説の吸血鬼」をも従え、世界征服も夢じゃありません！", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 94, "", 1, 2, 60001, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 95, "", 1, 2, 60001, 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 96, "", 1, 2, 60001, 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 97, "", 2, 2, 60001, 0, "今日の運勢は姫吉！　その高い運気はまさにショーグンの如く！　その溢れる威光は人々を惹きつけ、皆の人気者間違いなしです！", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 98, "", 1, 2, 60001, 0, "今日の運勢は大吉！　運気がどんどん高まっています！　　　　　何をやっても、最大効率で素晴らしい結果になりますよ♪", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 99, "", 1, 2, 60001, 0, "今日の運勢は大吉！　なにをやっても上手くいって大活躍！　　　そんな素敵なあなたを見て、後ろから誰かが……クスクス♪", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 100, "", 1, 2, 60001, 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 101, "", 1, 2, 60001, 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 102, "", 2, 2, 60001, 0, "今日の運勢は大吉！　運気が高く、何かに挑戦すると良い結果に！隠れた才能が引き出されそう！　目指せヒデサ……ではなく秀才！", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 103, "", 1, 2, 60001, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたいやき！　和菓子パワーで売上アップです！", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 104, "", 1, 2, 60001, 0, "今日の運勢は中吉！　旅行運がぐんぐんと上昇中♪　　　　　　　もしかしたら、あの「マホマホ王国」にだって行けるかも♪", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 105, "", 1, 2, 60001, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 106, "", 1, 2, 60001, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 107, "", 1, 2, 60001, 0, "今日の運勢は中吉！　お出かけした先で良縁に恵まれそうです！　ダウナー系あざとい女子が、あま～い飴をくれるかも？", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 108, "", 1, 2, 60001, 0, "今日の運勢は中吉！　大抵のことはゴリ押しでなんとかできます！ラッキープレイスはゲーセン。パンチングマシンでストレス発散！", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 109, "", 2, 2, 60001, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかの如く、色々な事がうまくいきますよ♪", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 110, "", 1, 2, 60001, 0, "今日の運勢は小吉！　早朝に幸運の兆しあり！　　　　　　　　　もしかしたら、優しいお姉ちゃんが起こしにきてくれますよ♪", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 111, "", 1, 2, 60001, 0, "今日の運勢は小吉！　運気上昇中ですが、上がるまでが要注意！　ラッキーアニマルは熊！　本当の家族のように守ってくれるかも♪", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 112, "", 1, 2, 60001, 0, "今日の運勢は小吉！　外に出てゆっくり過ごすと運気が上昇！　　ラッキースポットは牧場。面白い出会いがありそうです♪", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 113, "", 1, 2, 60001, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 114, "", 1, 2, 60001, 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 115, "", 1, 2, 60001, 0, "今日の運勢は小吉！　思わぬ相手と仲良くなれるかも？　　　　　うっかり毒舌をもらしてしまわないように要注意です！", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 116, "", 2, 2, 60001, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 112101, 0, 117, "スズメ", 0, 3, 60001, 0, "おみくじの結果はいかがでしたか？\n新たに始まる一日が、\nあなたにとってよい日になりますように\n明日もお待ちしていますね♪", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 112101, 0, 118, "スズメ", 0, 3, 60001, 7, "おみくじ、楽しんで頂けましたか？\nあなたの新しい年が\n素晴らしいものになるよう、\n心からお祈りしますね", 3, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 119, "ペコリーヌ", 0, 0, 80003, 1, "ヒューヒュー♪\nドンドンパフパフー♪", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 120, "コッコロ", 0, 1, 80003, 1, "ひゅーひゅー\nどんどんぱふぱふー\nでございます", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 121, "コッコロ", 0, 1, 80003, 1, "さぁ、キャルさまもご一緒に\nどんどんぱふぱふいたしましょう", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 122, "キャル", 0, 2, 80003, 1, "え？　ちょっと\nいきなりなにっ？", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 123, "キャル", 0, 2, 80003, 1, "ドンドンパフパフってなんなの？\nあたしにも分かるように\nちゃんと説明しなさいっての！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 124, "ペコリーヌ", 0, 0, 80003, 1, "実はですねキャルちゃん！\nもうすぐわたしたちにとっての\n大切な節目──", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 125, "ペコリーヌ", 0, 0, 80003, 1, "『プリンセスコネクト！\nRe:Dive』\n2.5周年なんですよ！\nやばいですね☆", 3, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 126, "コッコロ", 0, 1, 80003, 1, "ですからその日に向けて\n今から気分を盛り上げているのです", 3, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 127, "キャル", 0, 2, 80003, 1, "ああ、そういえば\nそんな時期だっけ\nって言っても、もう少し先じゃない\n気が早いんじゃないの？", 3, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 128, "コッコロ", 0, 1, 80003, 1, "いいえ、キャルさま\nこういったお祝いは準備から\n楽しむものでございます\nそうですよね、ペコリーヌさま", 4, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 129, "ペコリーヌ", 0, 0, 80003, 1, "その通りです♪　というわけで！\nカウントダウンの始まりですよ！\nみんなで一緒に2.5周年に向けて\n盛り上がっていきましょー☆", 4, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 130, "キャル", 0, 2, 80003, 1, "ド、ドンドンパフパフ～\nって何言わせんのよ！\nまったくもう、浮かれちゃってさ", 4, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 131, "コッコロ", 0, 1, 80003, 1, "ふふ。キャルさまもワクワクして\nおいでのようですね\nそれでは主さま。大切な記念日まで\nどうぞご期待くださいませ", 5, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 132, "キャル", 0, 0, 80003, 2, "記念日を盛り上げるったって\n一体どうしたらいいのよ？\nあたし、そういうの\n苦手なんだけど…", 5, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 133, "カリン", 0, 1, 80003, 2, "あら、キャルさん\nどうかなさいましたか？\n何かお困りのようですけど", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 134, "キャル", 0, 0, 80003, 2, "げっ…カリンじゃない\nなんでもないわよ！", 6, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 135, "カリン", 0, 1, 80003, 2, "そうなのですか？\nキャルさんのことですからてっきり\n2.5周年をどう盛り上げたら\nいいか悩んでいるのかと…", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 136, "キャル", 0, 0, 80003, 2, "分かってんじゃないのよ！？\nいっ、いや、違うけどね！\nあたしは別にそんなことで\n悩んでないわよっ？", 7, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 137, "カリン", 0, 1, 80003, 2, "ふふっ…\nこういう時は、真心を込めて\n気持ちをそのまま口にしたら\nいいのではないでしょうか？", 3, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 138, "キャル", 0, 0, 80003, 2, "気持ちを、ねぇ\nそれが一番難しいんじゃない…\nそもそも、あたしは記念日とか\n別にどうだっていいし", 8, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 139, "キャル", 0, 0, 80003, 2, "…まあ、ペコリーヌもコロ助も\nやけに楽しそうだったから…\nこういうお祭り騒ぎみたいなのも\nたまにはいいかな、とは思うけど", 9, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 140, "カリン", 0, 1, 80003, 2, "なるほどなるほど～\nキャルさんは【美食殿】で祝う\n2.5周年を心から楽しみに\nしている、ということですね！", 4, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 141, "キャル", 0, 0, 80003, 2, "はぁ！？\nどこ聞いたらそうなるのよ！\nあたしは別に楽しみになんか…！", 10, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 142, "カリン", 0, 1, 80003, 2, "キャルさんの心からの想い\nみなさんにも伝わったでしょうか？\n私も2.5周年が楽しみです！\n以上、カリンがお伝えしました！", 5, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 143, "キャル", 0, 0, 80003, 2, "心からの想いって何なのよ！？\n勝手に人の言葉を\n捻じ曲げんじゃないわよ！\nこのくそ眼鏡ーーーっ！", 11, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 144, "コッコロ", 0, 0, 80003, 3, "ペコリーヌさま、もうすぐ\n記念日でございますね\nこういった節目というのは\n感慨深いものでございます", 6, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 145, "ペコリーヌ", 0, 1, 80003, 3, "色んな思い出が蘇ってきますね！\n楽しい出来事が\nいっぱいありました♪", 5, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 146, "コッコロ", 0, 0, 80003, 3, "はい、そうでございますね\n主さまも【美食殿】の活動の他にも\nいろんなご経験をされたと\n聞いておりますよ", 7, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 147, "コッコロ", 0, 0, 80003, 3, "たしか…ランドソルで話題沸騰と\nなっていた、魔法少女なるものに\nお会いになられたとか", 8, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 148, "ペコリーヌ", 0, 1, 80003, 3, "魔法少女って、あの美味しくって\n栄養たっぷりの大ヒット商品\n『魔法少女ソーセージ』の箱に\n描いてある女の子のことですか！？", 6, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 149, "ペコリーヌ", 0, 1, 80003, 3, "あのソーセージ\n美味しいんですよね～♪\nわたしもたっくさん食べてますよ！", 7, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 150, "コッコロ", 0, 0, 80003, 3, "あとは、牧場に素敵な温泉が\n出来たとか…", 9, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 151, "ペコリーヌ", 0, 1, 80003, 3, "牧場ですか！？　温泉につかって\nチーズもオツですね～♪　考えた\nだけでよだれが出ちゃいそうです！\nやばいですね☆", 8, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 152, "コッコロ", 0, 0, 80003, 3, "ペコリーヌさま\n言ってるそばからよだれが…\n今お拭きしますね。ふき、ふき", 10, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 153, "ペコリーヌ", 0, 1, 80003, 3, "えへへ、ありがとうございます\nコッコロちゃん！", 9, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 154, "コッコロ", 0, 0, 80003, 3, "それにしても、主さまは\n【美食殿】の一員として様々な\n美食と出会われていたのですね\nわたくし、感服いたしました", 11, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 155, "ペコリーヌ", 0, 1, 80003, 3, "これからもたくさん冒険をして\nめいっぱい美食を\n味わい尽くしましょうね！", 10, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 156, "ペコリーヌ", 0, 0, 80003, 4, "2.5周年カウントダウン♪\nキャルちゃんキャルちゃん！\nわくわくしますね☆", 11, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 157, "キャル", 0, 1, 80003, 4, "あぁもう、うるさいわね～\nまだまだ先でしょ？\nちょっとは落ち着きなさいよ", 12, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 158, "ペコリーヌ", 0, 0, 80003, 4, "キャルちゃんだって最近\nソワソワしてるじゃないですか～\nさっきもご機嫌そうに鼻歌とか\n歌ってましたよね？", 12, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 159, "キャル", 0, 1, 80003, 4, "なっ…！　き、聞いてたの！？\nじゃない、歌ってないわよ！？\nあんたいい加減なこと言うと\nぶっ殺すわよ！？", 13, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 160, "ペコリーヌ", 0, 0, 80003, 4, "えっへへ～♪\nわたしは最近のキャルちゃんが\nもっともっと大好きですよ♪\nすごく積極的になりましたよね！", 13, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 161, "キャル", 0, 1, 80003, 4, "…積極的？\nなんの話よ？", 14, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 162, "ペコリーヌ", 0, 0, 80003, 4, "またまた～♪\nアイドルを目指そうとしたこと\n忘れちゃったんですか？", 14, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 163, "ペコリーヌ", 0, 0, 80003, 4, "ムーサの町で\nきゃるきゃる～ん☆　って！", 15, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 164, "キャル", 0, 1, 80003, 4, "あっ…！？　ちちち違うわよっ！\nあれは操られてただけで\nあたしはアイドルなんか\n目指してないっての！！", 15, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 165, "ペコリーヌ", 0, 0, 80003, 4, "本当に本当ですか？\nわたし、キャルちゃんとっても\n乗り気だなって\n思ってたんですけど～", 16, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 166, "キャル", 0, 1, 80003, 4, "まぁ、悪くはなかったけど…って\nだ、だから目指してないって\n言ってるでしょ！！\nなんてこと思い出させんのよ！？", 16, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 167, "キャル", 0, 1, 80003, 4, "ああ…ダメだわ…\nもう殺すしかない…\n2.5周年が来る前に\n記憶ごと消し去ってやるー！", 17, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 168, "キャル", 0, 0, 80003, 5, "2.5周年まであと10日…\nふ～ん？\n案外早いもんね？", 18, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 169, "コッコロ", 0, 1, 80003, 5, "そうでございますね…\nその日のためにやるべきことは\nまだまだございます\n気を引き締めねばなりません…！", 12, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 170, "キャル", 0, 0, 80003, 5, "やる気十分ねコロ助…\nそんな気負ってるとしんどいわよ？\nお気楽にやりましょ？", 19, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 171, "コッコロ", 0, 1, 80003, 5, "キャルさま…\nありがとうございます\nキャルさまは本当に\n優しいおかたです", 13, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 172, "キャル", 0, 0, 80003, 5, "な、なにわけの分かんないこと\n言ってんのよ…\nあたしは優しくなんかないっての", 20, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 173, "コッコロ", 0, 1, 80003, 5, "そんなことはございません\n…あの、実はわたくし\nキャルさまに\nひとつお願いがございまして", 14, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 174, "キャル", 0, 0, 80003, 5, "お願い？　珍しいわね\nコロ助がそんなこと言うなんて\n…まあ、あたしに出来ることなら\n別にいいけど", 21, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 175, "コッコロ", 0, 1, 80003, 5, "ありがとうございます\n実は記念日へ向けて\n『かくし芸』というものを\n用意してみようかと思いまして", 15, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 176, "キャル", 0, 0, 80003, 5, "かくし芸？", 22, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 177, "コッコロ", 0, 1, 80003, 5, "はい。きゃるきゃる～ん☆　を\n参考に、ころころ～ん☆　という\nご挨拶を考えてみたのですが\nポーズがうまくいかなくて…", 16, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 178, "キャル", 0, 0, 80003, 5, "～～！！　ちょっと褒められて\nいい気になって損したわ！！\nふざけんなふざけんな\nふ～ざ～け～ん～な～っ！！", 23, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 179, "ペコリーヌ", 0, 0, 80003, 6, "あと９日！　もうすぐですよ♪\nえへへ、楽しみで楽しみで\nごはんが進みますね☆", 17, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 180, "キャル", 0, 2, 80003, 6, "ごはんが進みますね☆\nじゃなーい！\nいくらなんでも食べ過ぎよ！\n記念日、迎えられなくなるわよ！？", 24, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 181, "コッコロ", 0, 1, 80003, 6, "大丈夫ですよキャルさま\n食事はわたくしたちの\n歩んできた道そのもの\nなのですから", 17, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 182, "ペコリーヌ", 0, 0, 80003, 6, "さっすがコッコロちゃん\nいいことを言いますね！\nそう、わたしたち\n【美食殿】の活動目的は─", 18, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 183, "キャル", 0, 2, 80003, 6, "─みんなで楽しく食事をすること\nでしょ？\nあれだけ食べ歩いてきたんだから\n分かってるわよ", 25, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 184, "コッコロ", 0, 1, 80003, 6, "はい…そうでございますね♪\nそれにしてもわたくしたち\n本当にいろいろなものを\n食べ歩いてきましたね…", 18, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 185, "キャル", 0, 2, 80003, 6, "そうね…ほんっとうにね…\n毒まみれのニセドラゴンとか\n恐竜…は逃げられちゃったっけ\nあとワニゴ…ワニの魔物とかね", 26, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 186, "キャル", 0, 2, 80003, 6, "そして、とうとう本物の\nドラゴンまで相手に\nしちゃったのよね、あたしたちって", 27, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 187, "キャル", 0, 2, 80003, 6, "信じられない強さだったわね\nあのドラゴン…やっぱり\n作戦はしっかり立てていかないと\nダメよね", 28, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 188, "ペコリーヌ", 0, 0, 80003, 6, "えへへ…☆\nキャルちゃんが色んなことを\n覚えていてくれて\nうれしいです♪", 19, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 189, "コッコロ", 0, 1, 80003, 6, "わたくしも鮮明に覚えておりますよ\n主さまもきっと…♪", 19, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 190, "キャル", 0, 2, 80003, 6, "あったり前でしょ！\n忘れないわよ、あんな滅茶苦茶な\nものばかり食べさせられて！\n…忘れられるわけ、ないじゃない", 29, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 191, "キャル", 0, 0, 80003, 7, "ねえちょっと、ちょっと待って！？\nカリンから、2.5周年記念の\n生放送に出演してほしいって\n言われたんだけど！", 30, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 192, "キャル", 0, 0, 80003, 7, "なんでそういう大事なことを\n急に言うわけ！？\nそんなの聞いてないわよ～！？", 31, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 193, "キャル", 0, 0, 80003, 7, "いっぱい人に見られちゃうのよね？\nなんであたしがそんなこと…", 32, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 194, "キャル", 0, 0, 80003, 7, "あー\nあー\n…声、これで大丈夫かしら？", 33, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 195, "キャル", 0, 0, 80003, 7, "聞き取りにくいかもしれないわね…\nもうちょっと明るい方がいいかも\nえっと…こんな感じ？", 34, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 196, "キャル", 0, 0, 80003, 7, "オイッスー☆", 35, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 197, "キャル", 0, 0, 80003, 7, "……\nいや、ないわ\nいつもどおりが一番ね、うん", 36, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 198, "キャル", 0, 0, 80003, 7, "もう、記念の生放送なんて\n超責任重大なやつじゃない…\nもしなにか失敗とかしたら…", 37, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 199, "キャル", 0, 0, 80003, 7, "ど、どど、どうしよう！？\n緊張してきちゃった…！！", 38, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 200, "コッコロ", 0, 0, 80003, 8, "主さま、わたくし\nペコリーヌさまとキャルさまと共に\n2.5周年を祝う生放送に\n出演する大役を仰せつかりました", 20, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 201, "コッコロ", 0, 0, 80003, 8, "多くの方々に\n『プリンセスコネクト！\nRe:Dive』の魅力をお伝えする\n重要な役割でございます", 21, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 202, "コッコロ", 0, 0, 80003, 8, "わたくし、全身全霊をもって\n生放送に取り組みたいと\n思っております", 22, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 203, "コッコロ", 0, 0, 80003, 8, "ですが、もしかしたら\nセリフを噛んでしまったり\n段取りを間違えてしまったり\nするかもしれません…", 23, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 204, "コッコロ", 0, 0, 80003, 8, "そのようなことがないよう\n練習はしっかりしておかなくては\nまずはこちらから…", 24, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 205, "コッコロ", 0, 0, 80003, 8, "オイッスー☆", 25, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 206, "コッコロ", 0, 0, 80003, 8, "先ほどキャルさまが練習されて\nいるのをお見かけしたので\nわたくしもと思いまして…\nいかがでしょうか？", 26, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 207, "コッコロ", 0, 0, 80003, 8, "良い感じ、ですか？\n…ふふ、ありがとうございます\n主さまのあたたかいお言葉があれば\nわたくしは百人力でございます", 27, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 208, "コッコロ", 0, 0, 80003, 8, "この大役を無事に成し遂げ\n主さまに素敵な2.5周年を\n迎えていただけるよう…\nわたくし、尽力いたしますね", 28, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 209, "ペコリーヌ", 0, 0, 80003, 9, "オイッスー☆", 20, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 210, "ペコリーヌ", 0, 0, 80003, 9, "…う～ん、今のはちょっと\n違う感じがしますね\n堅苦しかったかもしれません", 21, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 211, "ペコリーヌ", 0, 0, 80003, 9, "あと６日で2.5周年ですか…", 22, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 212, "ペコリーヌ", 0, 0, 80003, 9, "この年月がオイッスーの\n歴史なんだと思うと\nじ～んとしちゃいます！\nやばいですね☆", 23, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 213, "ペコリーヌ", 0, 0, 80003, 9, "生放送で最高のオイッスー☆　を\nみなさんにお届けするために\n頑張らないと！\nそれじゃあもう一度…", 24, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 214, "ペコリーヌ", 0, 0, 80003, 9, "オイッスー☆", 25, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 215, "ペコリーヌ", 0, 0, 80003, 9, "…うう～ん、どうしてでしょう\nまだ何かが違う気がします…\nもしかしたら\nおなかが空きすぎてるとか？", 26, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 216, "ペコリーヌ", 0, 0, 80003, 9, "今さっき食べたばっかりですけど\nおなかが減っては\n良いオイッスー☆　は\n出せませんよね！", 27, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 217, "ペコリーヌ", 0, 0, 80003, 9, "そうと決まれば、コッコロちゃんと\nキャルちゃんを誘って\nごはんにしましょう！\n善は急げです！", 28, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 218, "ペコリーヌ", 0, 0, 80003, 9, "あ、二人が丁度いいところに！\nオイッス～☆　…ああ！！\n今の、今のですよ～♪", 29, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 219, "ペコリーヌ", 0, 0, 80003, 9, "なるほど、どんな時も\n自然体が一番ってことですね！\nこの調子で、生放送も\n頑張っちゃいます♪", 30, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 220, "ペコリーヌ", 0, 0, 80003, 10, "2.5周年まで残り５日ですが\nその前にもうすぐ生放送ですよ！\nコッコロちゃん\n準備の方はどうですか？", 31, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 221, "コッコロ", 0, 1, 80003, 10, "はい。わたくし、しっかりと\n備えてまいりました\n万事抜かりはございません", 29, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 222, "ペコリーヌ", 0, 0, 80003, 10, "おお～すごい自信を感じます…！\nいい生放送になりそうですね☆\n……あれ？　なんだかこの辺り\n揺れていませんか？", 32, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 223, "キャル", 0, 2, 80003, 10, "…………", 39, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 224, "コッコロ", 0, 1, 80003, 10, "キャルさま？\nお風邪をひかれたんでしょうか\nひどい震えですが…", 30, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 225, "キャル", 0, 2, 80003, 10, "かかかか風邪じゃないわよ！\nここここれはただ\nななな生放送が楽しみ過ぎて\nワワワワクワクが止まらないだけ！", 40, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 226, "ペコリーヌ", 0, 0, 80003, 10, "大丈夫ですかキャルちゃん！？\nそうだ、これを飲んでください！", 33, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 227, "キャル", 0, 2, 80003, 10, "きき気がきくじゃない、ありがとっ\nごくっ、んく…ぶはぁっ！？\nちょっと何飲ませたの！？\n辛っ！　苦ぁ！？　甘ぁっ！？", 41, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 228, "ペコリーヌ", 0, 0, 80003, 10, "これは魔物のエキスに薬草に\nその他色んなものを混ぜた\n特製の栄養ドリンクです！", 34, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 229, "ペコリーヌ", 0, 0, 80003, 10, "これを飲めば体ぽかぽかで\n元気いっぱいですよ♪", 35, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 230, "キャル", 0, 2, 80003, 10, "このアホリーヌ！\n風邪じゃないって言ったでしょ！？\nどさくさに紛れて\nそんな恐ろしいもん飲ませんな～！", 42, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 231, "コッコロ", 0, 1, 80003, 10, "キャルさま\n震えが収まっておりますね\nよかったです…\nわたくし、心配いたしました", 31, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 232, "キャル", 0, 2, 80003, 10, "え？　ああ、ホントね…って\nだから風邪じゃないって\n言ってるのに…\nまあいいわこの際なんでも", 43, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 233, "ペコリーヌ", 0, 0, 80003, 10, "えっへへ～♪　いつも通りの\nキャルちゃんに戻りましたし\n素敵な生放送が出来そうですね！\n今から楽しみです☆", 36, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 234, "カリン", 0, 0, 80003, 11, "ランドソルのみなさま、こんにちは\n生放送の会場設営を担当しています\n【ギルド管理協会】のカリンです", 6, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 235, "カリン", 0, 0, 80003, 11, "【美食殿】のみなさんは\nまもなく始まる生放送に向けて\n最後の調整のため\n席を外しています", 7, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 236, "カリン", 0, 0, 80003, 11, "頑張っている３人の\n邪魔をするわけには\nいきませんので、ご容赦ください", 8, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 237, "カリン", 0, 0, 80003, 11, "ですので、本日は私から\n【美食殿】のみなさんの様子を\nお伝えさせていただこうと思います", 9, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 238, "カリン", 0, 0, 80003, 11, "まずはペコリーヌさんですが…\n何やら大量のおにぎりを\n食べているようです\nえっと…栄養は大事ですよね", 10, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 239, "カリン", 0, 0, 80003, 11, "次にコッコロさんですが\nこちらは発声練習をしています", 11, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 240, "カリン", 0, 0, 80003, 11, "一生懸命、小さなお口を開けて\n声を出す姿が応援したくなりますね", 12, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 241, "カリン", 0, 0, 80003, 11, "そしてキャルさんは…\nこれは…堂々としたものですね\n何もせず、ただ立ち尽くして…", 13, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 242, "カリン", 0, 0, 80003, 11, "あれ？\nもしかして緊張で気を失って…？", 14, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 243, "カリン", 0, 0, 80003, 11, "…ええと\n【美食殿】のみなさんは\nやる気十分なようですね！", 15, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 244, "カリン", 0, 0, 80003, 11, "３人とも生放送を\nいいものにしようと\n全力で頑張ってくれていますので\nどうかご期待ください", 16, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 245, "カリン", 0, 0, 80003, 11, "それでは\nまた明日お会いしましょう♪", 17, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 246, "キャル", 0, 0, 80003, 12, "2.5周年まであと３日！\nそして生放送は明日！\nなんかいよいよって感じね…", 44, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 247, "ペコリーヌ", 0, 2, 80003, 12, "３人でい～っぱい練習しましたし\nきっと大丈夫ですよ☆", 37, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 248, "コッコロ", 0, 1, 80003, 12, "ペコリーヌさまに\n大丈夫と言ってもらえると\nとても心強いですね", 32, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 249, "キャル", 0, 0, 80003, 12, "信じすぎちゃだめよコロ助\nこいつはなーんにも\n考えてないだけなんだから", 45, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 250, "ペコリーヌ", 0, 2, 80003, 12, "ひどいですよぉキャルちゃ～ん！", 38, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 251, "コッコロ", 0, 1, 80003, 12, "ふふ。お二人とも\n普段通りの様子で\n安心いたしました", 33, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 252, "ペコリーヌ", 0, 2, 80003, 12, "はいっ☆\n生放送でもなんでも\n全力全開、わたしらしく\nぶつかっていくだけです！", 39, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 253, "キャル", 0, 0, 80003, 12, "そうね。おめでたいことなんだし\nここまで来たんなら\n楽しめるだけ\n楽しむしかないわよね！", 46, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 254, "コッコロ", 0, 1, 80003, 12, "わたくしも、普段よりも心が\n熱くなっております\nこの胸の気持ちをお伝えできるよう\n精一杯努力いたします…！", 34, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 255, "ペコリーヌ", 0, 2, 80003, 12, "それでは、いきましょう！\n明日の生放送、絶対に\n成功させましょうね☆", 40, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 256, "ペコリーヌ", 0, 0, 80003, 13, "えっと、最初のひと言は…あれ？\nキャルちゃん、わたし\n何て言うんでしたっけ？", 41, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 257, "キャル", 0, 2, 80003, 13, "は！？\nなにいきなりど忘れしてるの！？\nっていうかあんた、台本は！？", 47, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 258, "ペコリーヌ", 0, 0, 80003, 13, "忘れてきちゃいました☆", 42, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 259, "キャル", 0, 2, 80003, 13, "忘れてきちゃいました☆\nで済ませられると思ってんの！？\nほら、あたし二冊持ってきたから\nこれ使いなさい！", 48, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 260, "コッコロ", 0, 1, 80003, 13, "マイクとは、こんな高い位置に\nあるものなのですね…！\n背伸びをすれば、何とか…\nう～ん、うぅ～ん…！", 35, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 261, "キャル", 0, 2, 80003, 13, "あぁもう\n少し下げればいいでしょ！？\nこれくらいでいい？\nまったく、世話が焼けるわね…", 49, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 262, "ペコリーヌ", 0, 0, 80003, 13, "あれ？\nキャルちゃん、後ろ髪が\nはねちゃってますよ？", 43, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 263, "キャル", 0, 2, 80003, 13, "え？　うそっ！？\nちゃんと確かめてきたのに！\nどこどこ！？", 50, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 264, "コッコロ", 0, 1, 80003, 13, "キャルさま、動かないで\nくださいまし。今くしで…\nはい、直りましたよ", 36, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 265, "キャル", 0, 2, 80003, 13, "あ、ありがと…はぁ。生放送\n本番までもうすぐなのに\nこんなことしてる場合じゃ\nないわよね", 51, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 266, "コッコロ", 0, 1, 80003, 13, "はい、時間は残りわずかです\nですが、慌ただしく\n動き回るこの時間も\nなんだか楽しくて…♪", 37, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 267, "キャル", 0, 2, 80003, 13, "コロ助、あんた…って\nそうじゃなくて！\n胸にジンワリきてる\n暇なんかないでしょ…！？", 52, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 268, "ペコリーヌ", 0, 0, 80003, 13, "あはは♪\nキャルちゃんの動きが\nとっても面白いです♪\nやばいですね☆", 44, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 269, "コッコロ", 0, 1, 80003, 13, "ふふ\nきっと面白い生放送になると\nわたくし、確信しております", 38, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 270, "ペコリーヌ", 0, 0, 80003, 13, "絶対絶対、間違いありません！\n見てくれるみなさんが\n笑顔になれる時間を\nお届けしましょう！", 45, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 271, "キャル", 0, 2, 80003, 13, "そんなの当然でしょ！\n誰が見たって面白いって\n言ってもらえるように\nあれだけ準備したんだから！", 53, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 272, "ペコリーヌ", 0, 0, 80003, 13, "それでは\n記念日直前生放送！\n楽しみにしててくださいね☆", 46, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 273, "カリン", 0, 0, 80003, 14, "こんにちは\n【ギルド管理協会】のカリンです", 18, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 274, "カリン", 0, 0, 80003, 14, "昨日の生放送は\nいかがだったでしょうか？", 19, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 275, "カリン", 0, 0, 80003, 14, "たくさんの笑顔と喜びと\nそして驚きを受け取って\nいただけたのではないかと思います", 20, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 276, "カリン", 0, 0, 80003, 14, "そしていよいよ\n明日は2.5周年の当日\n待ちに待った記念日を\n迎えることとなります", 21, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 277, "カリン", 0, 0, 80003, 14, "【美食殿】のみなさんも\n張り切って様々な準備を\nされていますよ", 22, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 278, "カリン", 0, 0, 80003, 14, "【ギルド管理協会】も\n万全のサポート体制で\n協力してまいりたいと思います", 23, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 279, "カリン", 0, 0, 80003, 14, "…ふふ、本当に楽しみですね\n【ギルド管理協会】の職員として\nだけではなく、私個人としても…", 24, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 280, "カリン", 0, 0, 80003, 14, "この記念日を迎えられることが\n心から楽しみですし\n幸せを感じています", 25, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 281, "カリン", 0, 0, 80003, 14, "きっと【美食殿】のみなさんは\nそれ以上に心を弾ませて\nいることでしょう", 26, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 282, "カリン", 0, 0, 80003, 14, "それでは\n明日からの2.5周年を\nどうぞ、お楽しみに…♪", 27, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 283, "ペコリーヌ", 0, 0, 80003, 15, "準備はいいですかっ？\n…いっきますよー！", 47, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 284, "キャル", 0, 2, 80003, 15, "祝！", 54, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 285, "コッコロ", 0, 1, 80003, 15, "2.5周年！", 39, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 286, "ペコリーヌ", 0, 0, 80003, 15, "おめでとうございま～す☆", 48, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 287, "キャル", 0, 2, 80003, 15, "少し前まではまだまだ先じゃない\nとか言ってたけど\n本当にあっという間だったわね", 55, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 288, "コッコロ", 0, 1, 80003, 15, "光陰矢の如し…\nとはこのことでございますね\nでも、今日という日を無事に\n迎えることができて良かったです", 40, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 289, "ペコリーヌ", 0, 0, 80003, 15, "コッコロちゃん！　キャルちゃん！\n落ち着くには\nまだ早いですよ！\n盛り上がるのはこれからです☆", 49, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 290, "キャル", 0, 2, 80003, 15, "ほんとあんたはいつも\n全力全開ねー\nでもそうね、記念日なんだし\nパーっといきましょ！", 56, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 291, "コッコロ", 0, 1, 80003, 15, "ええ、わたくしも全力全開で\nまいります…！\n主さま、さあ\nどうぞ手を取ってくださいまし…♪", 41, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 292, "キャル", 0, 2, 80003, 15, "あんたもコロ助も、浮かれて\n転ぶんじゃないわよ？\n…仕方ないから、あたしも\n手を繋いであげるわよ", 57, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 293, "ペコリーヌ", 0, 0, 80003, 15, "あー！　二人ともずるいです！\nわたしもっ、ギュー♪", 50, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 294, "キャル", 0, 2, 80003, 15, "ちょっ、ペコリーヌ！\nくっつき過ぎよ！", 58, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 295, "ペコリーヌ", 0, 0, 80003, 15, "記念日だから\n平気平気♪\nやばいですね☆", 51, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 296, "キャル", 0, 2, 80003, 15, "意味分かんないわよ！", 59, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 297, "コッコロ", 0, 1, 80003, 15, "ふふ。このめでたき日に\n喜びがあふれておりますね\n主さまは…いかがでしょうか？", 42, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 298, "コッコロ", 0, 1, 80003, 15, "喜んでいただけているならば\nわたくしはとてもとても\n幸せでございます", 43, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 299, "ペコリーヌ", 0, 0, 80003, 15, "さぁ、2.5周年を\n楽しみ尽くしますよ☆\nまだまだ食べたいものもありますし\nやりたいこともたくさんです！", 52, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 300, "キャル", 0, 2, 80003, 15, "分かった、分かったから\n引っ張るんじゃないわよ！\n…そんな掴まなくても\nちゃんとついていくから", 60, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 301, "コッコロ", 0, 1, 80003, 15, "ペコリーヌさま…キャルさま…\n主さま…共にまいりましょう\nどこまでも…！", 44, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 302, "ペコリーヌ", 0, 0, 80003, 15, "はい！　それでは2.5周年\n食べつくしツアーへ！\nそして、その先の未来へ\n向かって出発しましょう！", 53, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("105901,45,106001,61", 105801, 1, 303, "ペコリーヌ・コッコロ・キャル", 0, 0, 80003, 15, "2.5周年\nありがとうございます！", 54, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190804, 0, 304, "カリン", 1, 1, 60002, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 305, "", 1, 2, 60002, 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 306, "", 1, 2, 60002, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 307, "", 1, 2, 60002, 0, "今日の運勢は姫吉！　最強の運勢でどんなドジも跳ね除けます！　大切な人と一緒に、最高の一日になること間違いなし！", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 308, "", 1, 2, 60002, 0, "今日の運勢は姫吉！　どんな挑戦も上手くいく、最高の運勢です！理想の自分に変身できる絶好の機会！　新しい一歩を踏み出そう！", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 309, "", 2, 2, 60002, 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 310, "", 1, 2, 60002, 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 311, "", 1, 2, 60002, 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 312, "", 1, 2, 60002, 0, "今日の運勢は大吉！　ラッキーワードは「ちぇる～ん♪」　　　　出会う人みんなに言ってあげると、ハッピーになれますよ！", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 313, "", 1, 2, 60002, 0, "今日の運勢は大吉！　運勢はバッチリで無敵状態！　　　　　　　龍眼で全てを見通して、思い通りの一日を過ごしましょう！", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 314, "", 2, 2, 60002, 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 315, "", 1, 2, 60002, 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 316, "", 1, 2, 60002, 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 317, "", 1, 2, 60002, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 318, "", 1, 2, 60002, 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 319, "", 1, 2, 60002, 0, "今日の運勢は中吉！　商売運が上がってきています！　　　　　　ラッキーアイテムはたい焼き！　和菓子パワーで売上アップです！", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 320, "", 1, 2, 60002, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 321, "", 2, 2, 60002, 0, "今日の運勢は中吉！　運気が着々と上昇中！　　　　　　　　　　精霊の加護を受けたかのごとく、色々な事がうまくいきますよ♪", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 322, "", 1, 2, 60002, 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 323, "", 1, 2, 60002, 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 324, "", 1, 2, 60002, 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 325, "", 1, 2, 60002, 0, "今日の運勢は小吉！　運気は高いけども、ハプニングには注意！　出かけた先で、「ふしんしゃ」扱いされてしまうかも……", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 326, "", 1, 2, 60002, 0, "今日の運勢は小吉！　同腹一心の友だちが見つかるかも！　　　　キーワードは「ユニちゃんズ」、記憶に刻みましょう！", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 327, "", 1, 2, 60002, 0, "今日の運勢は小吉！　周りに流されず、マイペースな一日を！　　ただし寝すぎには注意ぐうたらし過ぎず適度な運動を、だってさ～", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 328, "", 2, 2, 60002, 0, "今日の運勢は小吉！　根を詰めずにリラックスすると運気向上！　ラッキーパーソンはアイドル。歌があなたを幸せにしてくれます♪", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190804, 0, 329, "カリン", 0, 3, 60002, 0, "おみくじの結果はどうでしたか？\n新たに始まる一日が、あなたに\nとって良い日になりますように\nまた明日も遊びに来て下さいね♪", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190804, 0, 330, "カリン", 0, 3, 60002, 7, "おみくじは楽しんで頂けましたか？\nあなたの新たなる年が\n素晴らしいものになるよう、\n心からお祈りいたします", 3, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 331, "コッコロ", 0, 4, 80005, 1, "ささ、シェフィさまはこちらへ…", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 332, "シェフィ", 0, 0, 80005, 1, "コッコロさん、どこへ行くの…？\n…え？", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 333, "ペコリーヌ", 0, 3, 80005, 1, "『おめでとうございます！\nわ～パチパチー！』\n…という感じでどうですかね！？", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 334, "コッコロ", 0, 4, 80005, 1, "ではわたくしも\n後ろからクラッカーを鳴らして\n応戦いたします\nああ、当日が待ち遠しいですね", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 335, "シェフィ", 0, 0, 80005, 1, "ええと…\n二人とも何をしているの？", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 336, "キャル", 0, 1, 80005, 1, "シェフィは初めてだもんね\nあの日が近いからって\n予行練習してんのよ\n気が早いわよね～", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 337, "シェフィ", 0, 0, 80005, 1, "あの日…？", 3, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 338, "ペコリーヌ", 0, 3, 80005, 1, "その通りです…\nいよいよ記念すべきあの日が\n近づいてきましたよ！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 339, "ペコリーヌ", 0, 3, 80005, 1, "『プリンセスコネクト！\nRe:Dive』3.5周年！", 3, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 340, "カリン", 0, 2, 80005, 1, "やばいですね☆", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 341, "キャル", 0, 1, 80005, 1, "って、なにしれっと\n参加してんのよカリン！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 342, "カリン", 0, 2, 80005, 1, "ふふ、いいじゃないですか\n【ギルド管理協会】として\n私もみなさんと一緒に\nお祝いをさせてください！", 2, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 343, "カリン", 0, 2, 80005, 1, "それに…記念日が近づけば\nとっておきの情報を\nお届けしますから♪", 3, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 344, "ペコリーヌ", 0, 3, 80005, 1, "というわけで\n今日からシェフィちゃんも一緒に\nカウントダウンしちゃいましょう！\n3.5周年まで…", 4, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 345, "シェフィ", 0, 0, 80005, 1, "えっ！？　ええとええと…！\nあ、あと14日…！", 4, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 346, "ペコリーヌ", 0, 3, 80005, 2, "3.5周年まであと13日\n豪華に、そして盛大に\nお祝いしたいですね☆", 5, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 347, "コッコロ", 0, 1, 80005, 2, "豪華といえば前にとある貴族さまが\n舞踏会を開かれたそうで\n主さまがそのお手伝いを\nしておりました", 3, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 348, "コッコロ", 0, 1, 80005, 2, "そこで美しい所作を学ばれたので\nわたくしも教えていただきました\nしゃなり、しゃなり…\nいかがでしょう？", 4, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 349, "ペコリーヌ", 0, 3, 80005, 2, "すっごく上手ですよ☆\nまるでお姫様みたいです\nせっかくなのでわたしも\nしゃなりしゃなり", 6, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 350, "コッコロ", 0, 1, 80005, 2, "さすがでございます\nペコリーヌさま", 5, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 351, "キャル", 0, 0, 80005, 2, "いや、あんたは\nできなきゃダメでしょ\n本物のお姫様なんだし", 3, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 352, "シェフィ", 0, 2, 80005, 2, "しゃなり、しゃなり…\nふふ、案外できるものね", 5, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 353, "ペコリーヌ", 0, 3, 80005, 2, "わぁ！\nシェフィちゃん\n姿勢がとってもキレイです♪", 7, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 354, "コッコロ", 0, 1, 80005, 2, "さ、次はキャルさまの\n番でございますよ", 6, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 355, "キャル", 0, 0, 80005, 2, "あ、あたしはいいわよ！\nそういうの全然分かんないし…", 4, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 356, "シェフィ", 0, 2, 80005, 2, "大丈夫\nやってみると結構楽しいわよ\nほらほらっ", 6, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 357, "キャル", 0, 0, 80005, 2, "そ、そこまで言うなら…\nしゃなにゅわきゃあっ！", 5, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 358, "キャル", 0, 0, 80005, 2, "いたたた…もぉお～！\nなんであたしがこんな目に～！", 6, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 359, "コッコロ", 0, 1, 80005, 2, "まぁまぁ\n記念日までに練習すれば\nできるようになるかもしれません\nよろしければお教えいたしますよ", 7, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 360, "キャル", 0, 0, 80005, 2, "よし！\nあんたたちができて\nあたしだけできないのはしゃくだし\nやってやろうじゃないの！！", 7, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 361, "コッコロ", 0, 1, 80005, 3, "3.5周年まであと12日\n記念日当日はもちろんですが\nその日を待つ時間というのも\n心躍ります", 8, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 362, "ペコリーヌ", 0, 3, 80005, 3, "分かりますっ！\nどんな特別な料理を食べられるのか\n考えるだけでワクワクしますよね！", 8, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 363, "コッコロ", 0, 1, 80005, 3, "特別な料理といえば、お祭りですね\nそういえば主さまは学生として\n聖学祭に参加されたこと\nがあるとか…", 9, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 364, "シェフィ", 0, 2, 80005, 3, "聖学祭…って、なにかしら？", 7, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 365, "コッコロ", 0, 1, 80005, 3, "聖テレサ女学院の祭典ですよ\n二つのチームが競い合い\n青春を満喫するのが趣旨のようです", 10, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 366, "キャル", 0, 0, 80005, 3, "それってカルミナの\nサプライズライブがあった\nお祭りよね？\nちょっと見たかったかも…", 8, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 367, "キャル", 0, 0, 80005, 3, "カルミナの後の\nライブも好評だったらしいじゃない\n確か、なかよし部\nだったっけ…？", 9, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 368, "ペコリーヌ", 0, 3, 80005, 3, "なかよし部…\n仲が良さそうな名前で\nやばいですね☆", 9, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 369, "キャル", 0, 0, 80005, 3, "いや、そのまんますぎでしょ…", 10, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 370, "シェフィ", 0, 2, 80005, 3, "聖学祭かぁ…なんだか楽しそうね\nそれになかよし部の人たちも\n気になるわ", 8, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 371, "ペコリーヌ", 0, 3, 80005, 3, "それじゃあわたしたちも、\n負けじと仲良くしましょう♪\nほらほらシェフィちゃん、\nぎゅーっ☆　ですよ♪", 10, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 372, "シェフィ", 0, 2, 80005, 3, "えっ？　ええ…\nぎゅーっ…？", 9, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 373, "キャル", 0, 0, 80005, 4, "3.5周年まであと11日！？\nお祝いの準備進んでないんだけど…\nああ～昨日に戻りたいわ…", 11, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 374, "シェフィ", 0, 2, 80005, 4, "そういえばそんな魔道具があるって\n聞いたことがあるわね\n確か、名前はタイムラーベ…", 10, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 375, "キャル", 0, 0, 80005, 4, "なにそれヤバいわね\nでも本当にあるんだったら\n準備よりももっとやり直したいこと\nたくさんあるんだけど…", 12, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 376, "コッコロ", 0, 1, 80005, 4, "もしや正月の件でしょうか…？\nあの時はお金がなくて\n苦労しましたから", 11, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 377, "キャル", 0, 0, 80005, 4, "あれはそうね…\nお金を湯水のように使う\nぺコリーヌを止められたら\nあんな苦労をすることもなかったし", 13, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 378, "ペコリーヌ", 0, 3, 80005, 4, "そんなこともありましたね！\nやり直したいといえば\n『きゃるきゃる～ん♪』\nの方かと思いましたよ！", 11, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 379, "キャル", 0, 0, 80005, 4, "バラすんじゃないわよ\nこのアホリーヌ！\nシェフィはそれ\n知らないんだから！", 14, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 380, "キャル", 0, 0, 80005, 4, "こうなったらもう、なんとか\nタイムラーべを探し出して\n今の会話をなかったことに…\nって、どうしたのよシェフィ", 15, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 381, "シェフィ", 0, 2, 80005, 4, "うん…もし、私だったら…\n私が知らないみんなとの時間を\n見てみたいな、って…", 11, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 382, "ペコリーヌ", 0, 3, 80005, 4, "シェフィちゃん！　タイムなんとか\nなんかなくても大丈夫ですよ！\n一緒の時間はこれから\nどんどん作ればいいんですから！", 12, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 383, "コッコロ", 0, 1, 80005, 4, "はい、今この瞬間も\n未来にはかけがえのない思い出に\nなっていることでしょう", 12, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 384, "キャル", 0, 0, 80005, 4, "だからそんな顔しないの\nほら、お祝いの準備、進めるわよ！", 16, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 385, "シェフィ", 0, 2, 80005, 4, "みんな…そうね\n最高のお祝いにして\n最高の思い出にしましょう！", 12, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 386, "ペコリーヌ", 0, 3, 80005, 5, "3.5周年まで、あと10日！\nもうすぐですよー！\n楽しみすぎて、やばいですね！", 13, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 387, "ペコリーヌ", 0, 3, 80005, 5, "そういえば…たくさんのおもちゃが\n子どもたちを襲うっていう\n騒動もありましたね…\nなんでも勝手に動き出したとか！", 14, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 388, "ペコリーヌ", 0, 3, 80005, 5, "学校や孤児院とかに\nちっちゃなおもちゃが乗り込んで\n暴れたみたいですよ！", 15, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 389, "キャル", 0, 0, 80005, 5, "暴れたって言っても\n所詮はおもちゃじゃない\nどうせちっさいんでしょ？", 17, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 390, "キャル", 0, 0, 80005, 5, "だったら魔法で\n全部ぶっ飛ばせばいいじゃない！\n大したことないわよ！", 18, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 391, "シェフィ", 0, 2, 80005, 5, "キャルってば…\n相手は子どもが\n大事にしてる物なのよ…？", 13, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 392, "コッコロ", 0, 1, 80005, 5, "乱暴な発言は\nめっ、でございますよ？\n子どもの教育に悪影響を\n与えてしまいますから…", 13, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 393, "ペコリーヌ", 0, 3, 80005, 5, "キャルちゃんだって\n意外と猫グッズとか\nたっくさん集めてますよね？\nもしその子たちが暴れたら…？", 16, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 394, "キャル", 0, 0, 80005, 5, "う、うっさいわね！\n意外とか言うな！\n…ま、まあ確かに正面切って\n魔法でぶっ飛ばせないかもね…", 19, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 395, "ペコリーヌ", 0, 3, 80005, 5, "あはは☆\nキャルちゃんのそういうところ\n好きですよ♪", 17, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 396, "ペコリーヌ", 0, 3, 80005, 5, "そんなキャルちゃんに猫グッズを\nプレゼントしちゃいますね！\n一部で流行っていた、たい焼き屋の\nおまけフィギュアですよ♪", 18, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 397, "ペコリーヌ", 0, 3, 80005, 5, "乱暴に扱ったりしないでくださいね\nひとりでに暴れ出しちゃうかも\nしれませんから！", 19, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 398, "カリン", 0, 2, 80005, 6, "3.5周年まであと９日\nここでみなさんに\nビックニュースですよ！", 4, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 399, "カリン", 0, 2, 80005, 6, "3.5周年を祝う生放送に\n去年と同様【美食殿】の\nみなさんにご出演いただくことが\n決定しましたー！", 5, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 400, "キャル", 0, 1, 80005, 6, "…えっ！？", 20, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 401, "ペコリーヌ", 0, 3, 80005, 6, "本当ですか！？\nそれじゃ今から張り切って\n生放送中に食べる魔物料理を\n作らなくちゃですね☆", 20, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 402, "シェフィ", 0, 0, 80005, 6, "いや…がんばるところは\nそこじゃないような…\nというか去年も出演してたのね\nすごいじゃない！", 14, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 403, "コッコロ", 0, 4, 80005, 6, "はい。とても緊張しますが\nやりがいのある大役です\n一緒にがんばりましょうね\nシェフィさま", 14, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 404, "シェフィ", 0, 0, 80005, 6, "わ、私も出るの！？　でも…\n私も【美食殿】の一人だものね\nそれなら今からしっかり準備をして\nコンディションを整えないと…", 15, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 405, "キャル", 0, 1, 80005, 6, "ふふん♪\n生放送直前のカチコチになった\nシェフィの姿が楽しみだわ！", 21, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 406, "ペコリーヌ", 0, 3, 80005, 6, "去年のキャルちゃんは\n緊張しすぎてずっと震えて\nかわいかったですもんね！\n今年もあの姿が見たいです！", 21, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 407, "キャル", 0, 1, 80005, 6, "ぶっ殺すぞ！？", 22, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 408, "カリン", 0, 2, 80005, 6, "というわけで\n『プリンセスコネクト！\nRe:Dive』の魅力を\nお伝えする生放送をお楽しみに♪", 6, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 409, "コッコロ", 0, 1, 80005, 7, "3.5周年まであと８日\nでございますよ\n楽しみですね、主さま", 15, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 410, "キャル", 0, 0, 80005, 7, "そういえばあんた\n夏休みの宿題は\nきちんとやってるの？", 23, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 411, "シェフィ", 0, 2, 80005, 7, "宿題…学校に通うのも\n楽しいことばかりじゃ\nないのね", 16, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 412, "ペコリーヌ", 0, 3, 80005, 7, "あれ？　そういえば\n少し前にルーセント学院で\n何かあったような…", 22, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 413, "キャル", 0, 0, 80005, 7, "ああ、始業式の日に\n大捕り物があったって\n話題になってたわね", 24, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 414, "シェフィ", 0, 2, 80005, 7, "夏休みを終わらせないって\n騒いでたっていう話？\nあれ本当なの？\n都市伝説だと思ってたわ", 17, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 415, "コッコロ", 0, 1, 80005, 7, "その一件ならよく存じ上げて\nおります。ですから主さま\n次の機会にはわたくしと一緒に\nがんばりましょう", 16, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 416, "シェフィ", 0, 2, 80005, 7, "楽しそう…私も一緒にやりたいな\nママ…じゃ、じゃなくて！\nコッコロさん、私もまざっていい？", 18, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 417, "コッコロ", 0, 1, 80005, 7, "もちろんでございます\n仲良くお勉強いたしましょう", 17, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 418, "キャル", 0, 0, 80005, 7, "しれっと教育ママが\n生まれてる…？", 25, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 419, "ペコリーヌ", 0, 3, 80005, 7, "お勉強は大切ですよ！\nキャルちゃんも一緒に\nがんばりましょう！", 23, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 420, "キャル", 0, 0, 80005, 7, "え～～～～！？", 26, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 421, "キャル", 0, 0, 80005, 8, "3.5周年まであと７日〜♪\nふふ～ん♪\nふんふふ～ん♪", 27, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 422, "シェフィ", 0, 2, 80005, 8, "…\nねぇコッコロさん\nキャル、どうしちゃったの？", 19, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 423, "コッコロ", 0, 1, 80005, 8, "とてもご機嫌そうに\n鼻歌を歌ってらっしゃいますね\n耳も尻尾もリズミカルに\n揺れて…ノリノリでございます", 18, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 424, "ペコリーヌ", 0, 3, 80005, 8, "あれはですね！\nカルミナのみなさんの\nサマーライブのチケットが\n手に入ったからなんですよ♪", 24, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 425, "シェフィ", 0, 2, 80005, 8, "ええっ！？\nあのライブのチケットって確か\n入手困難だったんじゃ…", 20, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 426, "キャル", 0, 0, 80005, 8, "ふふふふ～ん♪\nしゃいにんぐふゅ～ちゃ～♪", 28, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 427, "コッコロ", 0, 1, 80005, 8, "なるほど…\nキャルさまがあのように\nなってしまうのも頷けますね", 19, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 428, "シェフィ", 0, 2, 80005, 8, "…カルミナの\n『Shining Future』\nの中に、シャイニングフューチャー\nって歌詞はなかったはずだけど…", 21, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 429, "キャル", 0, 0, 80005, 8, "ふんふ…はっ！？\nあっ、あんたたち！\nなに人の鼻歌を\n勝手に聞いてるのよ！？", 29, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 430, "キャル", 0, 0, 80005, 8, "こっ、これは別に\nカルミナの曲じゃなくて…\nあたしのオリジナルソングよ！\n聞いたらお金取るわよっ！？", 30, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 431, "ペコリーヌ", 0, 3, 80005, 8, "えへへ、キャルちゃん\nカルミナのサマーライブ\n思いっきり楽しみましょうね☆", 25, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 432, "キャル", 0, 0, 80005, 8, "も～っ！\n生暖かい目で見るな～～！\nぶっ殺すわよ～～～！", 31, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 433, "シェフィ", 0, 0, 80005, 9, "3.5周年まであと６日\n３人も言ってたけど\nあっという間だったわね", 22, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 434, "シェフィ", 0, 0, 80005, 9, "…えっ？\n生放送の意気込み！？\n突然なに！？", 23, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 435, "シェフィ", 0, 0, 80005, 9, "ええと…\nとにかく失敗しないように\n台本たくさん読んで…\nそれから…", 24, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 436, "シェフィ", 0, 0, 80005, 9, "えっ！？\nトラブルがあったら\nどうするのかって！？\nそ、それは…！", 25, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 437, "シェフィ", 0, 0, 80005, 9, "とにかく落ち着いて\nスタッフさんの指示を聞いて…", 26, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 438, "シェフィ", 0, 0, 80005, 9, "それから、それから…！\nぅ、ぅぅっ…！", 27, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 439, "シェフィ", 0, 0, 80005, 9, "―びえぇぇ～んっ！！！", 28, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 440, "コッコロ", 0, 1, 80005, 9, "どうされましたか、シェフィさま", 20, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 441, "シェフィ", 0, 0, 80005, 9, "ううっ…ひっく…\nママッ…！", 29, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 442, "コッコロ", 0, 1, 80005, 9, "よしよし、緊張されてるのですね\nママが傍におりますよ\n主さま、少々お待ちくださいませ", 21, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 443, "コッコロ", 0, 1, 80005, 9, "…ふぅ\nシェフィさま\n生放送への意気込み\nお話しできそうですか？", 22, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 444, "シェフィ", 0, 0, 80005, 9, "…ううっ\n恥ずかしすぎて\nもう生放送出られない…", 30, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 445, "コッコロ", 0, 0, 80005, 10, "主さま\n3.5周年まであと５日\nでございます", 23, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 446, "コッコロ", 0, 0, 80005, 10, "ですがその前に\n生放送がありますね", 24, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 447, "コッコロ", 0, 0, 80005, 10, "…生放送に向けた\n意気込みでございますか？", 25, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 448, "コッコロ", 0, 0, 80005, 10, "もちろんわたくしは\n主さまのために\n全身全霊を込めて\n楽しい時間をご提供いたします", 26, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 449, "コッコロ", 0, 0, 80005, 10, "…と、意気込んでみましたが\nうまくできるか少し不安です\n声が小さくなったり\n間違えてしまったらどうしようと…", 27, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 450, "コッコロ", 0, 0, 80005, 10, "ですがわたくしは\n一人ではありません\n【美食殿】のみなさまが\nおります", 28, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 451, "コッコロ", 0, 0, 80005, 10, "どんな困難も\nみなさまと一緒なら\n乗り越えられると\nわたくし、確信しております", 29, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 452, "コッコロ", 0, 0, 80005, 10, "それに今回はシェフィさまも\nご参加されるわけですし\nママとしてお手本に\nならねばなりませんね", 30, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 453, "コッコロ", 0, 0, 80005, 10, "主さま。3.5周年も\n食卓を囲んでいる時のような\n楽しい思い出を\n一緒に作りましょうね", 31, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 454, "ペコリーヌ", 0, 0, 80005, 11, "3.5周年まであと４日！\nやばいですね☆", 26, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 455, "キャル", 0, 1, 80005, 11, "はいはい、やばいわね\nというかもうすぐ生放送だけど\nあんた準備はできてるの？", 32, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 456, "ペコリーヌ", 0, 0, 80005, 11, "ばっちりオイッスー☆　ですよ！\n『王家の装備』も全開です！", 27, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 457, "ペコリーヌ", 0, 0, 80005, 11, "あとは前回を超える\n最高のオイッスー☆　を\nお届けできるように\n練習あるのみですかね！", 28, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 458, "ペコリーヌ", 0, 0, 80005, 11, "キャルちゃんは\nどうなんですか？\nオイッスー☆　を\n毎日ちゃんと練習してますか？", 29, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 459, "キャル", 0, 1, 80005, 11, "はぁ！？　なんであたしまで\nその変なあいさつを練習しないと\nいけないのよ！", 33, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 460, "ペコリーヌ", 0, 0, 80005, 11, "もしかしてやってないんですか？\nダメですよキャルちゃん！\nシェフィちゃんだってちゃんと\n毎日練習してるのに！", 30, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 461, "ペコリーヌ", 0, 0, 80005, 11, "こうなったらわたしがキャルちゃん\nにオイッスー☆　の『オ』から\nしっかり教えてあげないと！", 31, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 462, "ペコリーヌ", 0, 0, 80005, 11, "オイッスー☆　の『オ』は\n口を大きく開いて〜\nドラゴンの骨つき肉に\nかぶりつく直前をイメージして〜", 32, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 463, "キャル", 0, 1, 80005, 11, "だからあたしはやるなんて一言も…", 34, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 464, "ペコリーヌ", 0, 0, 80005, 11, "オイッスー☆", 33, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 465, "キャル", 0, 1, 80005, 11, "聞きなさいっての！！", 35, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 466, "シェフィ", 0, 2, 80005, 12, "3.5周年まであと３日…\nそして生放送は、明日…", 31, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 467, "シェフィ", 0, 2, 80005, 12, "もっと台本を\n読み込んでおかないと…\nあと発声練習も…", 32, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 468, "シェフィ", 0, 2, 80005, 12, "おいっす！\n…こうじゃなかったわね\nええと確か…", 33, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 469, "シェフィ", 0, 2, 80005, 12, "うう…あんなに練習したのに\nこれじゃみんなに迷惑かけちゃう…", 34, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 470, "シェフィ", 0, 2, 80005, 12, "【美食殿】の一員として\n認められるように\n頑張らないといけないのに\nよし、もう一度…", 35, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 471, "ペコリーヌ", 0, 3, 80005, 12, "やってますねシェフィちゃん！", 34, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 472, "キャル", 0, 0, 80005, 12, "なによ、考えることは\nみんな同じってこと？", 36, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 473, "コッコロ", 0, 1, 80005, 12, "ふふ。シェフィさま\nよろしければ\n仲間に入れてください\n一緒にやればきっとうまくできます", 32, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 474, "シェフィ", 0, 2, 80005, 12, "みんな…もちろんよ！", 36, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 475, "ペコリーヌ", 0, 3, 80005, 12, "それじゃ明日の生放送に向けて\n一緒に練習がんばりましょう☆", 35, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 476, "カリン", 0, 2, 80005, 13, "3.5周年まであと２日と\n迫った本日は…\nいよいよ生放送です！", 7, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 477, "カリン", 0, 2, 80005, 13, "【美食殿】のみなさんが\n準備に入られていますので\nそれぞれ繋いでみましょう！\nまずはペコリーヌさんです！", 8, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 478, "ペコリーヌ", 0, 3, 80005, 13, "今日もオイッスー☆\nみんなで一緒に\nオイッスー☆", 36, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 479, "カリン", 0, 2, 80005, 13, "お手本になるような\n発声練習ですね！\nそれでは続いてコッコロさん", 9, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 480, "コッコロ", 0, 4, 80005, 13, "はじめちょろちょろ\nなかぱっぱ～♪\n生放送前にみなさまで\n食卓を囲んで英気を養いましょう", 33, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 481, "カリン", 0, 2, 80005, 13, "さすが【美食殿】のママですね！\nそしてキャルさんは…", 10, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 482, "キャル", 0, 1, 80005, 13, "大丈夫…大丈夫…\nあたしは大丈夫…", 37, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 483, "カリン", 0, 2, 80005, 13, "す、すごく震えてますけど\n大丈夫でしょうか…？\nそして今回初参加となる\n期待の新人シェフィさん！", 11, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 484, "シェフィ", 0, 0, 80005, 13, "あうー？", 37, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("105901,34,106001,38,190801,12", 105801, 1, 485, "みんな", 0, 4, 80005, 13, "あ…", 37, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 486, "キャル", 0, 1, 80005, 13, "ちょ、ちょっとシェフィ！？\nなに赤ちゃん返りしてん―\nあ痛ぁっ！\n噛んだわこいつーっ！", 39, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 487, "コッコロ", 0, 4, 80005, 13, "シェフィさま\n緊張しすぎて\nしまったのでしょうね…\nおーよしよし…", 35, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 488, "ペコリーヌ", 0, 3, 80005, 13, "シェフィちゃん！\nそういう時は手のひらに\n好きな文字を書いて\n食べちゃうといいですよ！", 38, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 489, "カリン", 0, 2, 80005, 13, "…ええと、現場からは以上です！\n生放送はもうすぐ！\n特別なお知らせもありますので\nどうぞお楽しみに！", 13, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 490, "シェフィ", 0, 2, 80005, 14, "3.5周年の記念日も\nいよいよ明日ね\n…って、あれ？", 38, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 491, "ペコリーヌ", 0, 3, 80005, 14, "記念日はこの森へ行きませんか！？\nすっごく美味しいお肉が\nとれるんです☆", 39, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 492, "キャル", 0, 0, 80005, 14, "うげ、またあの魔物？\nさすがに今度は\n丸焼きとかはやめてよね…\n見た目がヤバすぎるし", 40, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 493, "コッコロ", 0, 1, 80005, 14, "ふふ、キャルさまもだいぶ\n魔物肉に慣れてきたようですね\n調理ならばわたくしに\nお任せください♪", 36, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 494, "シェフィ", 0, 2, 80005, 14, "みんな、何をしているの？\nなんだか、\n不穏な単語が聞こえたんだけど…", 39, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 495, "ペコリーヌ", 0, 3, 80005, 14, "シェフィちゃん！\n明日の食べ尽くしツアーの\n相談をしてたんですよ！", 40, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 496, "コッコロ", 0, 1, 80005, 14, "はい。明日は【美食殿】の\n一員となったシェフィさまと一緒に\n初めて記念日を過ごすのですから\n特別なコース料理を用意しませんと", 37, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 497, "キャル", 0, 0, 80005, 14, "ふふん♪\n猫の毛も逆立つような\nあれこれを食べさせられるから\n覚悟しておいたほうがいいわよ？", 41, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 498, "シェフィ", 0, 2, 80005, 14, "へ、へぇ…", 40, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 499, "ペコリーヌ", 0, 3, 80005, 14, "期待しててくださいね！\nシェフィちゃんとあなたに\n『おいちー！』って喜んでもらえる\n最高のごちそうを準備しますから☆", 41, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 500, "シェフィ", 0, 2, 80005, 14, "ええと…その…うーんと…\nわ、分かったわ\n私も【美食殿】の一員だもの", 41, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 501, "シェフィ", 0, 2, 80005, 14, "それにあなたも一緒みたいだし\n最後までがんばってみるわ…！", 42, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 502, "ペコリーヌ", 0, 3, 80005, 15, "それではいつものあれを\nやりましょう！\n準備はいいですかっ？\n…いっきますよー！", 42, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 503, "キャル", 0, 1, 80005, 15, "祝！", 42, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 504, "コッコロ", 0, 4, 80005, 15, "3.5周年！", 38, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 505, "シェフィ", 0, 0, 80005, 15, "おめでとうございます！", 43, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 506, "カリン", 0, 2, 80005, 15, "この日を迎えられたのも\nあなたが『プリンセスコネクト！\nRe:Dive』を遊んでくれている\nおかげです！", 14, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190801, 0, 507, "カリン", 0, 2, 80005, 15, "ということで\nみなさんからあなたへ一言ずつ\n感謝の言葉をどうぞ！", 15, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 508, "ペコリーヌ", 0, 3, 80005, 15, "感謝の言葉ですか？　わたしは\n毎日あなたに感謝してますよ\n【美食殿】の仲間になってくれて…\n一緒にごはんを食べてくれて…", 43, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 509, "ペコリーヌ", 0, 3, 80005, 15, "なにより今でもわたしをぺコリーヌ\nって呼んでくれてありがとうござい\nます。これからもわたしはあなたの\nぺコリーヌです！　やばいですね☆", 44, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 510, "キャル", 0, 1, 80005, 15, "えっ！？　今度はあたし！？\n感謝って…まぁ、そうね…\nあんたにはあたしが\n辛くて苦しい時に助けてもらって…", 43, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106001, 0, 511, "キャル", 0, 1, 80005, 15, "でもおかげで色々吹っ切れたわ！\nもしあんたが困ってたら今度は\nあたしが助けてあげるから\nその時はちゃんと言いなさいよ！", 44, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 512, "シェフィ", 0, 0, 80005, 15, "ええと…次は私ね\n実はよく覚えてないのだけど\n空から落ちてきた私を受け止めて\nくれたのはあなたなのでしょう？", 44, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 106401, 0, 513, "シェフィ", 0, 0, 80005, 15, "最初に私を見つけてくれたのが\nあなたで良かったって思ってるの\nおかげで私は居場所を見つけたから\nあなたがくれたもの、大切にするわ", 45, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 514, "コッコロ", 0, 4, 80005, 15, "では最後にわたくしから…\nわたくしは主さまの元を離れた日…\nこのように記念日をお祝いする\nことは二度とないと思っていました", 39, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 515, "コッコロ", 0, 4, 80005, 15, "ですが、主さまはわたくしを\n迎えにきてくださり、今もこうして\nおそばにおいてくださっています\nわたくしにとって毎日が記念日です", 40, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105901, 0, 516, "コッコロ", 0, 4, 80005, 15, "わたくしたちの物語は\nまだ続いていきます\nこれからも一緒にページを\n作っていきましょうね", 41, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 105801, 0, 517, "ペコリーヌ", 0, 3, 80005, 15, "それじゃ\nいつものあれでしめますよ！\nみんなで一緒に、さんはい☆", 45, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("105901,42,106001,45,106401,46,190801,16", 105801, 1, 518, "みんな", 0, 4, 80005, 15, "これからも\nよろしくおねがいします！", 46, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 190804, 0, 519, "カリン", 1, 1, 60003, 0, "新年を迎え、新たに始まる一日を\nおみくじで占ってみませんか？\n良い運勢であるほど、\n沢山のプレゼントが貰えますよ♪", 1, 0);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 520, "", 1, 2, 60003, 0, "今日の運勢は姫吉！　どんな不可能も可能にできちゃう！　　　　仲間と食卓を囲めばさらに運気上昇よ！　ただし魔物料理以外！", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 521, "", 1, 2, 60003, 0, "今日の運勢は姫吉！　やること全てが最高潮！　やばいですね☆　ラッキーアイテムはおにぎり！　お腹一杯で幸せが続くでしょう！", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 522, "", 1, 2, 60003, 0, "今日の運勢は姫吉！　羽が生えたように飛躍できる絶好調の運気！新しいことに挑戦するなら今しかないわ！　やってみましょう！", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 523, "", 1, 2, 60003, 0, "今日の運勢は姫吉！　精霊も新年の幸福をお祝いしています！　　主さまの笑顔が見られて、わたくしも幸せいっぱいでございます♪", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 524, "", 2, 2, 60003, 0, "今日の運勢は姫吉！　やること全てが上手くいく最高の一日！　　あなたの活躍に先生もにっこりです。いい子いい子♪", 0, 1);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 525, "", 1, 2, 60003, 0, "今日の運勢は大吉！　お裁縫好きな女の子のお墨付きです！　　　お世話したがりの妹にめいっぱい愛されちゃうかも！？", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 526, "", 1, 2, 60003, 0, "今日の運勢は大吉！　ラッキーカラーは赤！　　　　　　　　　　湧き上がるアイデアの数々に、高笑いが止まりませんわ！", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 527, "", 1, 2, 60003, 0, "今日の運勢は大吉！　ラッキーカラーは鮮やかな黄色！　　　　　さらにシマシマのアイテムを持つと、運気倍増らしいッスよ♪", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 528, "", 1, 2, 60003, 0, "今日の運勢は大吉！　秘められた力が開花するでしょう！　　　　じゃあ、私の龍眼と力比べしてみようか？　ふふ、冗談だよ～", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 529, "", 2, 2, 60003, 0, "今日の運勢は大吉！　悩んでいたことが解決しそうです！　　　　たまには勉強も仕事も忘れて、心あたたまる家族と過ごしましょ！", 0, 2);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 530, "", 1, 2, 60003, 0, "今日の運勢は中吉！　家の中でゆっくり過ごすのがよさそう！　　ラッキーアイテムはゲームよ！　ベストスコアを更新できるかも？", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 531, "", 1, 2, 60003, 0, "今日の運勢は中吉！　上手くなりたいことに積極的に挑戦してみてサックス好きの妹が、手取り足取りサポートしてくれるかも～？", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 532, "", 1, 2, 60003, 0, "今日の運勢は中吉！　仕事運が急上昇中です！　　　　　　　　　きっと「煉獄に舞う一陣の疾風」の如き活躍ができますよ！", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 533, "", 1, 2, 60003, 0, "今日の運勢は中吉！　日頃の努力が報われます！　　　　　　　　親しい友人がいるなら報告してみて。一緒に喜んでくれるはずだ。", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 534, "", 1, 2, 60003, 0, "今日の運勢は中吉！　ラッキーアイテムはかわいいもの！　　　　ア、アタシはかわいいじゃなくてキレイだってば！　も～っ！", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 535, "", 1, 2, 60003, 0, "今日の運勢は中吉！　チャンスを待つと良い結果に！　　　　　　ラッキーアイテムのプリンを食べて、運を呼び込みましょう！", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 536, "", 2, 2, 60003, 0, "今日の運勢は中吉！　悩まず行動すれば強運に恵まれる！　　　　守るよりも攻めるが吉だ！　勝負事をするにはいい運勢だな！", 0, 3);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 537, "", 1, 2, 60003, 0, "今日の運勢は小吉！　まだ見ぬ危険が隠れているかも！　　　　　でも安心しろ！　提督が貴公を守ってくれるはずだぞ！", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 538, "", 1, 2, 60003, 0, "今日の運勢は小吉！　いろんな事件が起こる一日になりそう！　　状況をよく観察してみようじゃないか！　まさに探偵のごとくね！", 0, 4);
INSERT INTO `v1_c2f34a4bface46c095efa5f618221c47512fd8c54abd735a4ba7194620b150ef` VALUES ("", 0, 0, 539, "", 1, 2, 60003, 0, "今日の運勢は小吉！　気の向くままに過ごすのが幸せへの近道！　美味い魚を食べて猫を眺めて、自然体で過ごすのはどうだい？", 0, 4);
